import Footer from './공용/3.footer/Footer';


function Main(){
    return(
        <div className="wrap">
            <Header></Header>
            <section>
                <h1>우리 오늘 뭐할까?</h1>
            </section>
            <Footer/>
        </div>
    )
}

export default Main;
